%pyspark
def j2i(a, b):
    try:
        if b == 0:
            return 0
        else:
            # return (b - a) / 60000000
            return (b - a)
    except:
        return None


solar_i = []
for i in range(1, len(solar)):
    solar_i.append(j2i(solar[i-1], solar[i]))
solar_i.append(0)

print(len(solar), len(solar_i))
